import React from 'react'
import '../App.css'
import logo from '../assets/PokeTrumps logo.png';



const MainBlock = () => {
    
    return (
        <div className="App">
          <img 
            src={logo} 
            className="App-logo" 
            alt="logo" 
            style={{ width:350, height: 100 }} 
        />
        </div>
        
    )
}


export default MainBlock
